import React from 'react';

function ConuAISection() {
    return (
        <div className="conuai-section">
            <h2>ConuAI</h2>
            <p>
                ConuAI is our innovative platform that leverages artificial intelligence to enhance user experience and streamline processes.
            </p>
        </div>
    );
}

export default ConuAISection;
